import './MostPopular.css';
import popular_01 from '../../assests/images/popular-01.jpg';
import popular_02 from '../../assests/images/popular-02.jpg';
import popular_03 from '../../assests/images/popular-03.jpg';
import popular_04 from '../../assests/images/popular-04.jpg';
import popular_05 from '../../assests/images/popular-05.jpg';
import popular_06 from '../../assests/images/popular-06.jpg';
import popular_07 from '../../assests/images/popular-07.jpg';
import popular_08 from '../../assests/images/popular-08.jpg';
import {Card,SectionHeader,SeactionWrapper} from '../../components/index'
import MostPopularData from '../../components/Data/MostPopularData';



const MostPopular= () =>{
 

  const cards = mostPopularItems.map(card =>{
    return <Card image={card.image} title={card.title} category={card.category} rate={card.rate} download={card.download} />
  })
  
 return(
   <>
    <SeactionWrapper>
      
      <SectionHeader>Most Popular</SectionHeader>

      
      <div className='most-popular-items'>
   
         {cards}
              </div>

              


             



         
      
    </SeactionWrapper>
   </>

 )
};
export default MostPopular;
